import React from 'react';
import './styles.css';
import ShoppingListSelection from './ShoppingListSelection'
import ShoppingListDisplay from './ShoppingListDisplay'
import { ShoppingList, ShoppingListCollection } from './ShoppingList'

export class ShoppingListView extends React.Component {


    constructor(props) {
        super(props)
        this.state = {
            listIndex: 0
        }
        this.changeListDisplayed = this.changeListDisplayed.bind(this)
    }

    changeListDisplayed(newIndex) {
        this.setState({
            listIndex: newIndex
        })
    }
    

    render() {

        return(
            <section className='container'>
               <section className='viewer'>
               <div className='column'>
                        <ShoppingListSelection />
                    </div>
                        
                    <div className='column'>
                        <ShoppingListDisplay />
                    </div>
               </section>
            </section>
        );
    }

}



export default ShoppingListView;
